import React from 'react';
import ReactDOM from 'react-dom';
import ClassesLIst from './ClassesList';

class Classes extends  React.Component{
    constructor(props){
        super(props);
        this.state = {
            clist: []
        };
    }

    componentDidMount(){
        fetch('https://6079395e460a6600174fb472.mockapi.io/api/v1/Classes')
        .then(res => res.json())
        .then((data) => {
          this.setState({ clist: data })
        })
        .catch(console.log) 
    }

    render(){
        return(

            <ClassesLIst clist={this.state.clist}/>
        );
    }
}

export default Classes;
